import React from 'react';
import { Container, Image } from 'react-bootstrap';
import '../home.css';


const Home:React.FC = () => {
    return (
     <Container className='mt-5' fluid >
        <h1 className='header'>Hi! I'm Ionut Ciornei </h1>
        <div className='style'>

        </div>
        <p >
        I'm on a mission to create intuitive and dynamic user experiences. </p>
        <p>With a background in driving, I bring <br /> a  unique perspective to software development.</p>
        <p> I'm excited <br /> to leverage my skills in a new career path focused on front-end development.</p>

        <Image src="/img/me.jpg" alt="me" className='imgStyle'/>
     </Container>      
    )
};

export default Home;
